import React from 'react'

function Camera() {
  return (
    <div>
      <div className="grid2 container">
      <div>
        <img className="img" src="https://m.media-amazon.com/images/I/914hFeTU2-L._SL1500_.jpg" alt="canon1300d"></img><br/><br/>
        <span className="blockquote m-auto" style={{fontSize:"18px"}}>Canon EOS 1500 D</span>
      </div>
      </div>
    </div>
  );
}

export default Camera
